import React from 'react';
import Navbar from './components/Navbar';


function Layout({ children }) {
  return (
    <div className="bg-white min-h-screen">
      <Navbar />
      <div className="container mx-auto px-4 py-8">
        {children}
      </div>
    </div>
  );
}

export default Layout;
